import Homescreens from './screens/Homescreens';

function App() {
  return <Router>

  <Header/>
  <main className='py-3'>
    <Container><Switch>
      <Route path='/' component={Homescreens} />
      </Switch>
      {/* <Homescreens/> */}
    </Container> 
 </main>
  <Footer/>

  </Router>

}

export default App;
